let obj = {}

for (let i = 0; i < arr.length; i++) {
  if (!obj[arr[i].state]) {
    obj[arr[i].state] = {
      date: arr[i].date,
      ws: [],
      dates: [arr[i].date],
      total: Number(arr[i].windspeed),
      num: 1
    }
  } else {
    if (arr[i].date == obj[arr[i].state].date) {
      obj[arr[i].state].total += Number(arr[i].windspeed)
      obj[arr[i].state].num++
    } else {
      const avg = obj[arr[i].state].total/obj[arr[i].state].num
      obj[arr[i].state].ws.push(avg)
      obj[arr[i].state].dates.push(arr[i].date)
      obj[arr[i].state].date = arr[i].date
      obj[arr[i].state].total = Number(arr[i].windspeed)
      obj[arr[i].state].num = 1
    }
  }
}

for (let j in obj) {
  const avg = obj[j].total/obj[j].num
  obj[j].ws.push(avg)
}

const arrBig = []
for (let k in obj) {
  for (let l in obj[k].ws) {
    let objSmall = {date: obj[k].dates[l], state: k, windspeed: obj[k].ws[l]}
    arrBig.push(objSmall)
  }
}

const csv = new ObjectsToCsv(arrBig)
csv.toDisk('./statePicker.csv')